import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Jumbotron, Badge } from 'react-bootstrap';


export default function Jumb(){
    return(
        <>
            <Jumbotron>

                <h1>Bem vindo!</h1>
                <h3>
                    Example heading <Badge variant="secondary">New</Badge>
                </h3>

            </Jumbotron>
        </>
    );
}
